import React from 'react';
import ReactDOM from 'react-dom';
//import './custom.scss';
import './index.css'
import Example from './components/sidebar/sidebar';

var Test = React.createClass({
    add: function(event){
        if(event.keyCode == 13){
           alert('Adding....');
        }
    },
    render: function(){
       return(
          <div>
           <input type="text" id="one" onKeyDown={this.add} />    
         </div>
       );
    }
});

ReactDOM.render(
    <Example/>,
    document.getElementById('root')
);
